/* station services */
.v1	{ fill: #FF0000; }
.v2	{ fill: #00FF00; }
.v3	{ fill: #FFDC00; }
.v4	{ fill: #0000FF; }

/* legend */

.lt	{ fill: #ffffff; font-family: Arial, Helvetica, sans-serif; font-weight: bold; font-size: 12px; }

.hw	{ fill: none; stroke-width: 2; stroke: #00AA00; }
.hl	{ fill: none; stroke-width: 2; stroke: #F00000; }

/* incursion */
.inc	{ fill: url(#incBg); }
.incs	{ fill: url(#incStBg); }

/* contested */
.con	{ fill: url(#conBg); }
